import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import './App.css';
import "bootstrap/dist/css/bootstrap.min.css";
import Avehicle from "./components/pages/Avehicle"

function App() {
  return (
    <Router>
      
    
    <Route path="/" component={Avehicle} />
    

    </Router>
  );
}

export default App;
